    "2016-07-27T22:42:03.631771",nt"name": "evaluation-of-contaminants-in-water-sediments-and-fish-of-the-wallkill-river-national-wild",nt"isopen":
    false,nt"url": null,nt"notes": "This study was conducted to more completely
    characterize the nature, extent and potential impacts of contaminants on aquatic
    biota of the Wallkill River NWR and to assess the significance of the presence of
    contaminants to refuge management. The study was designed with three objectives
    that would assist the refuge manager and, if indicated, help to focus further study.
    These objectives are: (1) determine the nature and extent of chemical contaminants
    suspected of being present on the Wallkill River NWR; (2) evaluate the bioavailability
    and toxic effects of identified contaminants on biota through residue analysis and
    bioassessment techniques; and, (3) evaluate spatial and temporal trends to determine
    which, if any, contaminants continue to enter the system.",nt"license_title":
